import React from 'react';
import { Box, Typography, List, ListItem, ListItemText, ListItemIcon, IconButton } from '@mui/material';
import StarIcon from '@mui/icons-material/Star';
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';

const Starred = () => {
  // Mock data - in a real app, this would come from your backend
  const starredItems = [
    { id: 1, query: "React performance optimization tips", timestamp: "Starred 2 days ago" },
    { id: 2, query: "GraphQL vs REST API comparison", timestamp: "Starred 1 week ago" },
    { id: 3, query: "Modern CSS best practices", timestamp: "Starred 2 weeks ago" },
  ];

  return (
    <Box sx={{ p: 3, height: '100vh', backgroundColor: '#0F172A' }}>
      <Typography variant="h4" sx={{ color: '#F8FAFC', mb: 3 }}>
        Starred
      </Typography>
      <List>
        {starredItems.map((item) => (
          <ListItem
            key={item.id}
            secondaryAction={
              <IconButton edge="end" sx={{ color: '#94A3B8' }}>
                <DeleteOutlineIcon />
              </IconButton>
            }
            sx={{
              backgroundColor: '#1E293B',
              borderRadius: 1,
              mb: 1,
              '&:hover': {
                backgroundColor: '#334155',
              },
            }}
          >
            <ListItemIcon sx={{ color: '#FBBF24' }}>
              <StarIcon />
            </ListItemIcon>
            <ListItemText
              primary={item.query}
              secondary={item.timestamp}
              sx={{
                '& .MuiListItemText-primary': {
                  color: '#F8FAFC',
                },
                '& .MuiListItemText-secondary': {
                  color: '#94A3B8',
                },
              }}
            />
          </ListItem>
        ))}
      </List>
    </Box>
  );
};

export default Starred;
